    title: "혼자공부하는 자바스크립트",
    content: "JavaScript",
    price: 120000,
    imges: jsImg,
  },

  {
    id: 1,
    title: "HTML 1시간안에 끝내기",
    content: "Born in Seoul",
    price: 110000,
    imges: html5Img,
  },

  {
    id: 2,
    title: "세상에서 가장 쉬운 CSS",
    content: "Born in the States",
    price: 130000,
    imges: cssImg,
